import Link from "next/link";
import styles from "Navbar.module";

const Navbar = () => (
  <div className={styles.container}>
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
    </ul>
  </div>
);

export default Navbar;
